import React from "react";
import css from "./css/NavBarSimple.modules.css";

class NavBarSimple extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      message: "Hello, guest!",
    }

  }

  render() {
    return (
      <div>
        <h1>My Gallery</h1>
        <div className={css.NavBar}>
          <span></span>
        </div>
      </div>
    );
  }
}

export default NavBarSimple;
